import { FaTrashCan } from "react-icons/fa6";

export function ToDo({task, deleteToDo, handleChange}) {

    return (
            <div id="item-list">
                <input onChange={handleChange} className="checkbox" type="checkbox"></input>
                <span className="custom-box"></span>
                {task.title}
                <FaTrashCan onClick={() => deleteToDo(task.id)} className="icon"/>
            </div>
    )
}
